import React, { useEffect, useState } from 'react'
import Router, { Navigate, useNavigate } from 'react-router-dom'
import './css/StudentList.css'
import axios from 'axios'

function StudentList({data}) {
  let asd;
  const [loading, setLoading] = useState(true)
  const [fetchedData, setfetchedData] = useState([]) 
  const navigate = useNavigate()
  
  const getData = async () =>{
    await axios.post('http://localhost:8085/api/getresults', data)
    .then((res)=>{
      console.log(res.data)
      if(res.data.message == 'notLoggedin'){
        //navigate('/')
      }
      else{
        asd = res.data;
        setfetchedData([...fetchedData,res.data])
        console.log('fetched', fetchedData)
        console.log('asd', asd)
      }
    })
    .catch((err) =>{console.log(err.message)})
  }

  useEffect(()=>{
    getData()
  },[])
  return (
    <div className='outer-outer-div'>
      <div className='outer-div'>
        <a href='google.com'>
        <div className='inner-div'>
          <h2>OMKAR ANAND KAMBLE</h2>
          <h3>SEM-VIII</h3>
          <h3>12345678</h3>
        </div>  
        </a>
        <div className='inner-div'>
          <h2>PARITA RAKESH JAMANE</h2>
          <h3>SEM-VIII</h3>
          <h3>12345678</h3>
        </div>  

        <div className='inner-div'>
          <h2>GAURANG BABAJI MESTRY</h2>
          <h3>SEM-VIII</h3>
          <h3>12345678</h3>
        </div>  
      
      </div>      
    </div>
    
  )
}

export default StudentList
